#document-file-uploader {
  position: fixed;
  z-index: 20;
  right: 10px;
  bottom: 10px;

  .uploader-app {
    width: 600px;
  }
  .el-empty {
    padding: 20px 0;
  }
  .file-panel {
    background-color: #fff;
    border: 1px solid #dcdfe6;
    border-radius: 6px;
    box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 0.2);

    .file-title {
      display: flex;
      height: 50px;
      line-height: 50px;
      padding: 0 15px;
      border-bottom: 1px solid #dcdfe6;

      .operate {
        flex: 1;
        text-align: right;
        .el-icon-close {
          font-size: 16px;
          cursor: pointer;
        }
      }
    }
    .file-list {
      position: relative;
      height: 240px;
      overflow-x: hidden;
      overflow-y: auto;
      background-color: #fff;
      font-size: 14px;

      > li {
        background-color: #fff;
      }
      >>> .uploader-file {
        border-bottom: 1px solid #dcdfe6;
        .uploader-file-info {
          padding: 0 10px;
        }
      }
    }
  }
  >>> .uploader-file-icon {
    &:before {
      content: '' !important;
    }
  }

  >>> .uploader-file-actions > span {
    margin-right: 6px;
  }
}

/* 隐藏上传按钮 */
#file-uploader-btn {
  position: absolute;
  clip: rect(0, 0, 0, 0);
}
